import { useRef } from "react";

const Auth = () => {
  const enteredEmail = useRef("");
  const enteredPassword = useRef("");
  const conformPassword = useRef("");

  const submitHandler = async (e) => {
    e.preventDefault();

    const response = await fetch(
      "https://identitytoolkit.googleapis.com/v1/accounts:signUp?key=AIzaSyBqVX_hW6BUUpe1061qr1J-wV_Ob4u66M4",
      {
        method: "POST",
        body: JSON.stringify({
          email: enteredEmail.current.value,
          password: enteredPassword.current.value,
          returnSecureToken: true,
        }),
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    const data = await response.json();

    if (response.ok) {
      console.log(data);
    } else {
      console.log(data);
    }
  };

  return (
    <form onSubmit={submitHandler}>
      <label>Email</label>
      <input type="text" ref={enteredEmail} required></input>
      <label>Password</label>
      <input type="text" ref={enteredPassword} required></input>
      <label>Conform Password</label>
      <input type="text" ref={conformPassword} required></input>
      <button type="submit">Sign Up</button>
    </form>
  );
};

export default Auth;
